def translate_instagram(user_input: str):
    lines = user_input.split('\n')
    text = ''

    for line in lines:
        if len(line) > 2:
            if line.startswith('..'):
                text += 'â €â €' + line[2:]

            elif line.startswith(',,'):
                count = 10 - len(line) // 4
                text += 'â € ' * count + line[2:]

            else:
                text += line

            text += '\n'

        elif line == '':
            text += 'â €\n'

        else:
            text += line

    return text
